import React from "react";
import ProductCard from "../ProductCard/ProductCard";

const Menu = ({ props }) => {
  return (
    <div className="menu">
      {props.map((props) => (
        <ProductCard key={props.id} product={props} />
      ))}
    </div>
  );
};

export default Menu;
